import React, { ComponentType } from 'react';
import { Navigate } from "react-router-dom";



export default function ProtectedRoute<T>({ children } : { children : ComponentType<T>}) {
    // if (!user) {
    //     // user is not authenticated
    //     return <Navigate to="/" />;
    //   }
    {children}
  }
